export const typesPosts = {
    POST: {
      PUSH: 'POST.PUSH',
      GET: 'POST.GET'
    },
  }


  
  export const postPush = (email, postDate, postHeadline, postText, postTime) => ({
    type: typesPosts.POST.PUSH,
    email,
    postDate,
    postHeadline,
    postText,
    postTime,
  })
  
  export const postGet = data => ({
    type: typesPosts.POST.GET,
    data
  })
